.card_box {
  width: 100%;
  height: 100%;
  display: flex;
  align-items: center;
  /* justify-content: center */
  padding: 25px;
  box-sizing: border-box;
  border-radius: 4px;

  .card_box_cir {
    width: 60px;
    height: 60px;
    border-radius: 50%;
    overflow: hidden;
    margin-right: 20px;
    display: flex;
    justify-content: center;
    align-items: center;

    .card_box_cir1 {
      width: 48px;
      height: 48px;
      border-radius: 50%;
      display: flex;
      justify-content: center;
      align-items: center;
    }
  }

  .card_box_txt {
    .sp1 {
      display: block;
      color: #252631;
      font-size: 24px;
    }

    .sp2 {
      display: block;
      color: #98A9BC;
      font-size: 12px;
    }
  }
}

